import Logo from './logo.png';
import { Button } from './button';
import { Link } from 'react-router-dom';
import Dropdown from './dropdown';
import './navbar.css';

const Navbar = () => {
  const [click, setClick] = useState(false);
  const [dropdown, setDropdown] = useState(false);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const onMouseEnter = () => {
    if (window.innerWidth < 960) {
      setDropdown(false);
    } else {
      setDropdown(true);
    }
  };

  const onMouseLeave = () => {
    if (window.innerWidth < 960) {
      setDropdown(false);
    } else {
      setDropdown(false);
    }
  };

  return (
    <>
      <nav className="navbar">
        <Link to='/' className="logo-img" onClick={closeMobileMenu}>
          Radha Patel
        </Link>
        <div className="menu-icon" onClick={handleClick}>
          <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
        </div>
        <ul className={click ? 'nav-item active' : 'nav-item'}>
          <li className='nav-item'>
            <Link to='/' className='nav-link' onClick={closeMobileMenu}>
              Home
            </Link>
          </li>
          <li
            className='nav-item'
            onMouseEnter={onMouseEnter}
            onMouseLeave={onMouseLeave}
          >
            <Link
              to='/projects'
              className='nav-link'
              onClick={closeMobileMenu}
            >
              Projects <i className='fa fa-caret-down' />
            </Link>
            {dropdown && <Dropdown />}
          </li>
          <li className='nav-item'>
            <Link
              to='/resume'
              className='nav-links'
              onClick={closeMobileMenu}
            >
              Resume
            </Link>
          </li>
          <li>
            <Link
              to='/contact-me'
              className='nav-link'
              onClick={closeMobileMenu}
            >
              Contact Me
            </Link>
          </li>
        </ul>
        <Button />
      </nav>
    </>


    //     <a className="navbar-left" href='/'>
    //       <img src={Logo} className="logo-img" alt="Radha Patel logo" />
    //     </a>
    //     <button className="navbar-toggler navbar-dark" type="button" data-toggle="collapse" data-target="#main-navigaton">
    //       <span className="navbar-toggler-icon"></span>
    //     </button>

    //     <div className="collapse navbar-collapse" id="main-navigation">
