    //         <li className="nav-item active">
    //           <a className="nav-link" href='/'>Home</a>
    //           <span className="sr-only">(current)</span>
    //         </li>
    //         <li className="nav-item">
    //           <div className="dropdown">
    //             <a className="nav-link" href="projects.html">
    //               <button className="dropbtn" href="projects.html">Projects
    //                 <i className="fa fa-caret-down"></i>
    //               </button>
    //             </a>
    //             <div className="dropdown-content">
    //               <a className="nav-link" href="invaders.html">Alien Invaders</a>
    //               <a className="nav-link" href="maze_runner.html">Maze Runner</a>
    //               <a className="nav-link" href="scheduler.html">Cornell Scheduler</a>
    //               <a className="nav-link" href="refugee_analysis.html">Refugee Data Analysis</a>
